import './App.css';
import Nav from "./parts/Nav";
import Footer from "./parts/Footer";
import Books from './lists/Books'
import Ebooks from "./lists/Ebooks";
import Borrowed from "./lists/Borrowed";
import Wishlist from "./lists/Wishlist";
function App() {
    return (
        <HashRouter>
            <Nav/> <Route exact path={"/"} component={FullProject} />
            <Route path={"/books"} component={Books} />
            <Route path={"/ebooks"} component={Ebooks} />
            <Route path={"/borrowed"} component={Borrowed} />
            <Route path={"/wishlist"} component={Wishlist} />
            <Switch>

            </Switch>
            <Footer/>
        </HashRouter>
    )
}
export default App;
